extern crate bincode;
extern crate serde;

use bellman::{Circuit, ConstraintSystem, SynthesisError};
use bellman::groth16::PreparedVerifyingKey;
use pairing::bls12_381::Bls12;
use pairing::{CurveAffine, Engine};

use sapling_crypto::circuit::num::AllocatedNum;
use sapling_crypto::circuit::pedersen_hash;
use sapling_crypto::jubjub::JubjubEngine;

use serde::{Serialize, Serializer, Deserialize};
use self::bincode::Error;

#[derive(Serialize, Deserialize, Debug)]
pub struct Fq12 {
    pub c0: Fq6,
    pub c1: Fq6,
}

#[derive(Serialize, Deserialize, Debug)]
pub struct Fq6 {
    pub c0: Fq2,
    pub c1: Fq2,
    pub c2: Fq2,
}

#[derive(Serialize, Deserialize, Debug)]
pub struct Fq2 {
    pub c0: Fq,
    pub c1: Fq,
}

#[derive(Serialize, Deserialize, Debug)]
pub struct Fq(pub [u64; 6]);

#[derive(Serialize, Deserialize, Debug)]
pub struct G1Affine {
    pub x: Fq,
    pub y: Fq,
    pub infinity: bool
}

#[derive(Serialize, Deserialize, Debug)]
pub struct G2Prepared {
    pub(crate) coeffs: Vec<(Fq2, Fq2, Fq2)>,
    pub(crate) infinity: bool,
}

#[derive(Serialize, Deserialize, Debug)]
struct OpenPreparedVerifyingKey {
    /// Pairing result of alpha*beta
    alpha_g1_beta_g2: Fq12,
    /// -gamma in G2
    neg_gamma_g2: G2Prepared,
    /// -delta in G2
    neg_delta_g2: G2Prepared,
    /// Copy of IC from `VerifiyingKey`.
    ic: Vec<G1Affine>,
}

struct PreparedVerifyingKeySer {
    pvk: PreparedVerifyingKey<Bls12>,
}

pub fn serialize_verifying_key(
    pvk: PreparedVerifyingKey<Bls12>
) -> Vec<u8>
{
    let pvk_exposed: OpenPreparedVerifyingKey = unsafe {
        std::mem::transmute(pvk)
    };

    bincode::serialize(&pvk_exposed).unwrap()
}

pub fn deserialize_verifying_key(
    bytes: Vec<u8>
) -> Result<PreparedVerifyingKey<Bls12>, Error>
{
    bincode::deserialize(bytes.as_slice()).map(|open: OpenPreparedVerifyingKey| {
        unsafe {
            std::mem::transmute(open)
        }
    })
}

#[cfg(test)]
mod test {
    use bellman::groth16::{generate_random_parameters, prepare_verifying_key, Proof};
    use rand::os::OsRng;
    use rand::Rng;

    use sapling_crypto::jubjub::JubjubBls12;

    use super::*;
    use base64;
    use std::ptr::eq;

    // todo reuse?
    #[derive(Clone)]
    pub struct PedersenDemo<E: JubjubEngine> {
        pub params: Box<E::Params>,
        pub image: Option<E::Fr>,
        pub preimage: Option<E::Fr>,
    }

    impl<E: JubjubEngine> Circuit<E> for PedersenDemo<E> {
        fn synthesize<CS: ConstraintSystem<E>>(
            self,
            cs: &mut CS,
        ) -> Result<(), SynthesisError>
        {
            let image = AllocatedNum::alloc(cs.namespace(|| "signal public input image"), || self.image.ok_or(SynthesisError::AssignmentMissing))?;
            image.inputize(cs.namespace(|| "image inputize"));
            let preimage = AllocatedNum::alloc(cs.namespace(|| "signal input preimage"), || self.preimage.ok_or(SynthesisError::AssignmentMissing))?;
            let preimage_bits = preimage.into_bits_le_strict(cs.namespace(|| "preimage_bits <== bitify(preimage)"))?;
            let image_calculated = pedersen_hash::pedersen_hash(
                cs.namespace(|| "image_calculated <== pedersen_hash(preimage_bits)"),
                pedersen_hash::Personalization::NoteCommitment,
                &preimage_bits,
                &self.params,
            )?.get_x().clone();
            cs.enforce(|| "image_calculated === image", |lc| lc + image.get_variable(), |lc| lc + CS::one(), |lc| lc + image_calculated.get_variable());
            Ok(())
        }
    }

    #[test]
    fn test_serialize_verifying_key() {
        let rng = &mut OsRng::new().unwrap();

        let params = {
            let c = PedersenDemo::<Bls12> {
                params: Box::new(JubjubBls12::new()),
                image: None,
                preimage: None,
            };
            // todo serialize proving key внутри params
            generate_random_parameters(c, rng).unwrap()
        };

        // Prepare the verification key (for proof verification)

        let pvk = prepare_verifying_key(&params.vk);

        let pvk_exposed: OpenPreparedVerifyingKey = unsafe {
            std::mem::transmute(pvk)
        };

        let r = serialize_verifying_key(prepare_verifying_key(&params.vk));

//        println!("{}", base64::encode(r.as_slice()));
//        println!("{}", pvk_exposed.alpha_g1_beta_g2.c0.c0.c0.0[0]);
//        println!("{}", pvk_exposed.ic[1].x.0[5]);

        assert_eq!(r.len(), 39964);
    }

    #[test]
    fn test_deserialize_verifying_key() {
        let vec = base64::decode(&"").unwrap();
        let bytes = vec.as_slice();

        // Prepare the verification key (for proof verification)

        let r = deserialize_verifying_key(Vec::from(bytes));

        let bincode_res: OpenPreparedVerifyingKey = bincode::deserialize(bytes).unwrap();

        // first data element
        assert_eq!(bincode_res.alpha_g1_beta_g2.c0.c0.c0.0[0], 16737815138181898999);
        // last data element
        assert_eq!(bincode_res.ic[1].x.0[5], 37625389648768098);
    }
}